import { useState } from 'react'
import { useNavigate } from 'react-router-dom';
import { Link } from 'react-router-dom';

function Signup() {
   const navigate = useNavigate();
   const [name, setName] = useState('');
   const [email, setEmail] = useState('');
   const [password, setPassword] = useState('');
   const [phone, setPhone] = useState('');
   const [gender, setGender] = useState('');
   const [heardFrom, setHeardFrom] = useState([]);
   const [city, setCity] = useState('');
   const [state, setState] = useState('');

   async function registerUser(event) {
      event.preventDefault();

      const data = {
         name,
         email,
         password,
         phone,
      };

      const response = await fetch('http://localhost:5000/api/register', {
         method: 'POST',
         headers: {
            'Content-Type': 'application/json',
         },
         body: JSON.stringify(data),
      });

      // const responseData = await response.json();
      // console.log(responseData);
   }

   function handleRegister() {
      navigate('/');
   }

   return (
      <div className="flex flex-col items-center justify-center min-h-screen bg-gray-100">
         <h1 className="mb-4 text-4xl font-bold">Register</h1>
         <form onSubmit={registerUser} className="w-full max-w-md">
            <div className="flex mb-4">
               <div className="w-1/2 pr-2">
                  <p>Already have an account <Link to="/login">Login</Link></p>
                  <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="name">
                     Name
                  </label>
                  <input
                     value={name}
                     onChange={(e) => setName(e.target.value)}
                     type="text"
                     placeholder="Name"
                     className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
                  />
               </div>
            </div>
            <div className="flex mb-4">
               <div className="w-1/2 pl-2">
                  <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="email">
                     Email
                  </label>
                  <input
                     value={email}
                     onChange={(e) => setEmail(e.target.value)}
                     type="email"
                     placeholder="Email"
                     className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
                  />
               </div>
            </div>
            <div className="flex mb-4">
               <div className="w-1/2 pr-2">
                  <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="password">
                     Password
                  </label>
                  <input
                     value={password}
                     onChange={(e) => setPassword(e.target.value)}
                     type="password"
                     placeholder="Password"
                     className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
                  />
               </div>
            </div>
            
            {/* ...existing input fields... */}
            <div className="mb-4">
               <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="phone">
                  Phone
               </label>
               <input
                  value={phone}
                  onChange={(e) => setPhone(e.target.value)}
                  type="tel"
                  placeholder="Phone"
                  className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
               />
            </div>
            <div className="mb-4">
               <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="gender">
                  Gender
               </label>
               <select
                  value={gender}
                  onChange={(e) => setGender(e.target.value)}
                  className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
               >
                  <option value="">Select Gender</option>
                  <option value="male">Male</option>
                  <option value="female">Female</option>
                  <option value="others">Others</option>
               </select>
            </div>
            <div className="mb-4">
               <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="city">
                  City
               </label>
               <select
                  value={city}
                  onChange={(e) => setCity(e.target.value)}
                  className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
               >
                  <option value="">Select City</option>
                  <option value="mumbai">Mumbai</option>
                  <option value="pune">Pune</option>
                  <option value="ahmedabad">Ahmedabad</option>
               </select>
            </div>
            <div className="mb-4">
               <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="state">
                  State
               </label>
               <select
                  value={state}
                  onChange={(e) => setState(e.target.value)}
                  className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
               >
                  <option value="">Select State</option>
                  <option value="gujarat">Gujarat</option>
                  <option value="maharashtra">Maharashtra</option>
                  <option value="karnataka">Karnataka</option>
               </select>
            </div>
            <button type="submit" onClick={handleRegister} className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline">
               Register
            </button>
         </form>
      </div>
   );
}

export default Signup;
